import React from "react";
class MainProfile extends React.Component{
    render(){
        var rank,rating=0,handle,firstName,lastName,city,organization;
        for(var i=0;i<this.props.data.length;i++){
            handle=this.props.data[i].handle;
            firstName=this.props.data[i].firstName;
            lastName=this.props.data[i].lastName;
            rank=this.props.data[i].rank;
            city=this.props.data[i].city;
            organization=this.props.data[i].organization;
            rating=this.props.data[i].rating;
        }
        var len=this.props.data.length;
        return(
            <div>
                {len>0 && 
                    <div className="col center s12 m6 l3 z-depth-2" style={{borderRadius:"10px"}}>
                        <table>
                            <thead>
                                <tr>
                                    <th>Contest of</th>
                                    <th className="right">{handle}</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>First Name: </td>
                                    <td className="right">{firstName}</td>
                                </tr>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>Last Name: </td>
                                    <td className="right">{lastName}</td>
                                </tr>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>Rank</td>
                                    <td className="right">{rank}</td>
                                </tr>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>Rating</td>
                                    <td className="right">{rating}</td>
                                </tr>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>City</td>
                                    <td className="right">{city}</td>
                                </tr>
                                <tr className="hoverable" style={{borderRadius:"10px"}}>
                                    <td>Organization</td>
                                    <td className="right">{organization}</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                }
            </div>

        )
    }
}
export default MainProfile
